import React from 'react';
import './searchbar.css'
const Searchbar=({inpchange,onbtnclk})=>{
    return(
        <div style={{display:'flex'}}>
            
<input type='text' className='br3 pad3 grow' onChange={inpchange} style={{flexBasis:'0px',flexGrow:'1',border:'2px solid black',paddingRight:'3px'}}></input>

<button type='submit' className='pa3 br3 grow' onClick={onbtnclk}>Detect</button>
       </div>
    );
}
export default Searchbar;
